import React from 'react';
import './button.css';

function Button(props) {
  const { name } = props;

  return (
    <div>
      <button type="button" className='a'>Hi! {name.join(', ')}</button>
      <button type="button" className='b'>Hi! {name.join(', ')}</button>
      <button type="button" className='c'>Hi! {name.join(', ')}</button>
    </div>
  );
}

export default Button;
